import React from "react";

class showroom extends React.Component {
  render() {
    const { showroomitems } = this.props;
    const { twowheel, fourwheel } = showroomitems;
    const workingDay = true;
    const style={
      color:"blue",
      backgroundColor:"yellow",
      fontFamily:"sans-serif"
    }
    const style1={
      color:"green",
      backgroundColor:"green",
      fontFamily:"sans-serif"
    }
    return (
      <>
        <h2 style={style}>
          {twowheel} & {fourwheel} Showroom
        </h2>
        {workingDay ? <h2 style={style1}>Showroom is Open</h2> : <h2 style={style1}>Showroom is Close</h2>}
      </>
    );
  }
}
export default showroom;
